'''
You are a hiker preparing for an upcoming hike. You are given heights, a 2D array of size rows x columns, where heights[row][col] represents the height of cell (row, col). You are situated in the top-left cell, (0, 0), and you hope to travel to the bottom-right cell, (rows-1, columns-1) (i.e., 0-indexed). You can move up, down, left, or right, and you wish to find a route that requires the minimum effort.
A route's effort is the maximum absolute difference in heights between two consecutive cells of the route.
Return the minimum effort required to travel from the top-left cell to the bottom-right cell.

Example 1:
Input: heights = [[1,2,2],[3,8,2],[5,3,5]]
Output: 2
Explanation: The route of [1,3,5,3,5] has a maximum absolute difference of 2 in consecutive cells.
This is better than the route of [1,2,2,2,5], where the maximum absolute difference is 3.

Example 2:
Input: heights = [[1,2,3],[3,8,4],[5,3,5]]
Output: 1
Explanation: The route of [1,2,3,4,5] has a maximum absolute difference of 1 in consecutive cells, which is better than route [1,3,5,3,5].

Example 3:
Input: heights = [[1,2,1,1,1],[1,2,1,2,1],[1,2,1,2,1],[1,2,1,2,1],[1,1,1,2,1]]
Output: 0
Explanation: This route does not require any effort.

Constraints:
rows == heights.length
columns == heights[i].length
1 <= rows, columns <= 100
1 <= heights[i][j] <= 106
'''
# from queue import PriorityQueue
from heapq import heapify, heappush, heappop
class Solution:
    def minimumEffortPath2(self, heights) -> int:
        rows = len(heights)
        cols = len(heights[0])
        ht = {(0,0): 0}
        traversed_set = set()
        def getLowestPoint():
            position, cost = sorted(ht.items(), key = lambda kv:(kv[1], kv[0]))[0]
            return (cost, position)
        count = 0
        while True:
            cost, position = getLowestPoint()
            traversed_set.add(position)
            del ht[position]
            r, c = position
            if r == rows-1 and c == cols-1:
                print(len(ht), count)
                return cost
            directions = [(0,1), (0,-1), (1,0), (-1,0)]
            for d_r, d_c in directions:
                next_r, next_c = r+d_r, c+d_c
                if (next_r, next_c) not in traversed_set and 0 <= next_r < rows and 0 <= next_c < cols:
                    next_cost = max(abs(heights[next_r][next_c] - heights[r][c]), cost)
                    # print(cost, position, next_cost, (next_r, next_c))
                    if (next_r, next_c) in ht:
                        next_cost = min(next_cost, ht[(next_r, next_c)])
                    ht[(next_r, next_c)] = next_cost
                    count += 1
        return None

    def minimumEffortPath(self, heights):
        m, n = len(heights), len(heights[0])
        dist = [[float('inf')] * n for _ in range(m)]
        minHeap = []
        minHeap.append((0, 0, 0))  # distance, row, col
        DIR = [0, 1, 0, -1, 0]
        while minHeap:
            d, r, c = heappop(minHeap)
            if r == m - 1 and c == n - 1:
                return d  # Reach to bottom right
            for i in range(4):
                nr, nc = r + DIR[i], c + DIR[i + 1]
                if 0 <= nr < m and 0 <= nc < n:
                    newDist = max(d, abs(heights[nr][nc] - heights[r][c]))
                    if dist[nr][nc] > newDist:
                        dist[nr][nc] = newDist
                        heappush(minHeap, (dist[nr][nc], nr, nc))

